import React from 'react';
import { View, Image, Button } from 'react-native';
import StyleCentre from './StyleCenter';

const Center =()=>{
    return <View style={StyleCentre.conteiner} >
           <Image style={StyleCentre.imgStyle} source={{uri:'https://www.meme-arsenal.com/memes/5e6c923fd6d154dba529dbec105e460e.jpg'}}></Image>
           <View style={StyleCentre.button}><Button title ="Edit" ></Button></View>
    </View>
}

export default Center;
